import styled from "styled-components";

export const HeroContainer = styled.div`
background-color: #92a8d1;
display:flex;
justify-content:center;
align-items: center;
padding: 0 30px;
height: 800px;
// position:relative;
`;
export const HeroBg = styled.div`
top:0;
right:0;
bottom:0;
left:0;
width: 100vw;
height: 100vh;
overflow: hidden;
`;
export const VideoBg = styled.video`
    width: 100vw;
    height: 100%;
    -o-object-fit: cover;
    object-fit:cover;
    background: #232a34;
`;
